import "./head.css";

export default function Head() {
    return (
        <div className="head">
            <img
                src="https://img.freepik.com/free-vector/lotus-flower-logo-icon-linear-style_126523-708.jpg?semt=ais_hybrid&w=740"
                alt="Logo"
                title="Logo"
                height="60px"
                width="240px"
            />
        </div>
    )
}
